import React from "react";

const UnderlineIcon = (props) => {
  return (
    <svg
      width="125"
      height="1"
      viewBox="0 0 125 1"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      <rect width="125" height="1" fill="#1B4332" />
    </svg>
  );
};

export default UnderlineIcon;
